import VueRouter from "vue-router"
import Main from "@/components/Main.vue";
import Vue from "vue";
import Login from "@/components/Login.vue";

Vue.use(VueRouter)
export default new VueRouter({
    routes:[
        {
            path:"/login",
            name:"login",
            component:Login
        },
        {
            path: "/",
            name:"main",
            component: Main
        },
        {
            path:"/charts",
            name:"charts",
            component:()=>import("@/components/Charts.vue")
        },
        {
            path:"/instruction",
            name:"instruction",
            component: ()=>import("@/components/Instruction.vue")
        }
    ]
})
